import React, { useState } from 'react';
import './MyAccountPage.css'; // Importa el archivo de estilos CSS

function MyAccountPage() {
  const [vendors, setVendors] = useState([
    {
      name: 'Juan',
      city: 'Quito',
      address: 'Dirección 1',
      phoneNumber: '123456789',
      whatsappNumber: '987654321',
      image: 'https://static.vecteezy.com/system/resources/previews/022/932/692/non_2x/pleading-face-emoji-yellow-face-emoji-with-a-small-frown-and-large-eyes-as-if-begging-or-pleading-popular-chat-elements-free-vector.jpg',
    }
  ]);
  const vendor = vendors[0];


  return (
    <div className="my-account-page">
      <h1 className="my-account-page-title">Mi Cuenta</h1>
      <div className='my-acconuyt-continer'>
        <div className='my-account-info'>
          {<img src={vendor.image} alt={vendor.name} className='info-image'/>}
        </div>
      </div>
    </div>
  );
}

export default MyAccountPage;
